"use strict";

function minimumRemoval(beans) {
    beans.sort((a, b) => a - b);
    let ans = s = beans.reduce((a, b) => a + b, 0);
    const n = beans.length;
    for (let i = 0; i < n; i++) {
        const v = beans[i];
        ans = Math.min(ans, s - v * (n - i));
    }
    return ans;
}
